INSERT INTO `taxtinfo` (`id`, `header_title`, `social_links`, `msg1`, `msg2`, `school_history`, `location`, `present`) VALUES
(1, 'হোমনা আদর্শ উচ্চ বিদ্যালয়+105673+hahs105673@gmail.com+01705100106', 'https://facebook.com/official.anauv/+https://www.twitter.com/+https://www.linkedin.com/+https://www.plus.google.com/', 'Chairman Message+Homna Adarsha High School started its rich tradition in 1989. The motto of this school is to make the students worthy citizens and able leaders to serve the country. Besides academic programmes, we do duly emphasize activities to explore their hidden talents. Our efforts are also directed to ensure their sound state of mind and body.  It really gives me immense pleasure to learn that the students of Homna Adarsha High School are groomed with digital contents and well acquainted with the ICT devices to face the challenges of the 21st century and globalization.  I wish Homna Adarsha high school will keep up its better tempo of excellence in the years to come.+309522551_founder_img.png', 'Head Teachers Message+Welcome to the Homna Adarsha High School website. As you read through the pages of this site, you will learn about our students, teachers, SMC members, our school and get feel for the vibrancy and strength of our wider Homna Adarsha High School community.  The magnificently designed Homna Adarsha High School was established in the years 1989. The institution stands in the heart of Homna upazila porishod. We consider every student as unique and so we maintain inclusive learning teaching environment at every step in our great set-up.  In an era of Information and Communication technology, due emphasis should be given on imparting knowledge on information technology along with high standard general educational in order to make our students worthy citizens of the present high teach world with this end in view, Homna Adarsha High School has opened a website so that everybody including students, guardians and ex-students of this school may be well informed of all the information and activities of the school. In Addition, classes are being conducted by efficient teachers with the help of smart board and multimedia, thereby enabling students to assimilate their lessons easily and effectively. The process of digitization is progressing steadily.  I am quite optimistic that we shall be able to achieve leading position in the field of education not only in Bangladesh but also in the international arena with the introduction of these modern systems and devices.+1688940550_headmaster_img.png', ' School History+<p>সংক্ষিপ্ত পরিচিতি: ১৯৮৬ সালে জাতীয় নীতিমালা অনুযায়ী হোমনায় একটি উচ্চ বিদ্যালয় সরকারিকরণের পর তৎকালীন অর্থ সচিব জনাব এম. কে আনোয়ার মহোদয় হোমনা সদরে একটি বেসরকারি উচ্চ বিদ্যালয় স্থাপনের স্বপ্ন দেখেন এবং গঠনের উদ্যোগ নেন। এরই ধারাবাহিকতায় জনাব এম. কে. আনোয়ার মহোদয়ের বলিষ্ট ভূমিকায় কুমিল্লা জেলাধীন হোমনা উপজেলার শিক্ষানুরাগী বাসিন্দা ও কর্মকর্তাদের উদ্যোগে ১৯৮৯ সালের ০৬ এপ্রিল হোমনার প্রাণকেন্দ্র উপজেলা সদরে &ldquo;হোমনা আদর্শ উচ্চ বিদ্যালয়&rdquo; আত্মপ্রকাশ করে, যা আজ এক বিশাল পরিসরে বিস্তৃত। শুরু থেকেই জনাব এক.কে আনোয়ার মহোদয়ের সুযোগ্য সন্তান ও দাতা সদস্য জনাব মাহমুদ&nbsp; আনোয়ার&nbsp; প্রতিষ্ঠানটি পরিচালনা ও উন্নয়নে বলিষ্ট ভূমিকা রেখে আসেন। সূচনালগ্ন থেকেই প্রতিষ্ঠাতা হিসেবে ছিলেন স্থানীয় আছাদপুর নিবাসী জনাব মোঃ সিরাজুল ইসলাম ও ঢাকাস্থ ধানমন্ডি নিবাসী জনাব&nbsp; মোঃ আবদুল মোমেন। এছাড়াও তৎকালিন হোমনার স্থানীয় ইউপি চেয়ারম্যন জনাব মোঃ হারুন মিয়া ও সাবেক ইউপি চেয়ারম্যন জনাব মোঃ রফিকুল ইসলাম দুলাল এবং হোমনা বাজার কমিটির&nbsp; সেক্রেটারী&nbsp; জনাব মোঃ জহিরুল&nbsp; হোক সহ আরোও গণমান্য ব্যক্তিবর্গের প্রত্যক্ষ&nbsp; ও পরোক্ষ সহযোগিতায় প্রতিষ্ঠানটি সুনামের সহিত এর উজ্জ্বল যাত্রা শুরু হবে।</p>\r\n<p>পরবর্তীতে&nbsp; জনাব এম.কে&nbsp; আনোয়ার মহোদয়েরই প্রধান পৃষ্ঠপোষকতায় ০১ জানুয়ারি ১৯৯১ সালে উক্ত প্রতিষ্ঠানটি&nbsp; একটি পূনাঙ্গ হাই স্কুল উন্নীত হয় এবং ০১ জানুয়ারি ২০০২ সালে কারিগরি শাখা চালু করা হয়। এলাকার&nbsp; দানবীর&nbsp; দাতাগণের সহযোগিতায় মোট ৫.২৫ একর জমি নিয়ে এই প্রতিষ্ঠান যাত্রা শুরু করে। পরবর্তীতে সংলগ্ন খাদিজা মেমোরিয়াল&nbsp; বালিকা উচ্চ বিদ্যালয় স্হাপনের জন্য ১.০০ একর হস্তান্তরের পর বর্তমান বিদ্যালয় মোট জমি ৪.২৫ একর। যার মধ্যে রয়েছে ৪ তলা বিশিষ্ট্য ০১টি ও ০৩ তলা বিশিষ্ট্য সহ মোট ২টি সুবিলাস একাডেমিক ভবন, ০৩ তলা&nbsp; বিশিষ্ট্য ০১ টি পাকা ও ০১ টি&nbsp; টিনসেড বিশিষ্ট্য আধা পাকা শিক্ষক বাসভবন এবং গাছপালা ঘেরা পাকা সীমানা প্রাচীর বেষ্টিত সুদৃশ্য ও সুবিলাস একটি খেলার মাঠ।&nbsp; বিদ্যালয়ে প্রবেশের জন্য চারপাশে রয়েছে ০৪ টি সুদৃশ্য প্রবেশ গেট। বর্তমানে প্রায়&nbsp; ১৮০০ শিক্ষার্থী নিয়ে এ প্রতিষ্ঠান সাফল্যের সাথে এগিয়ে চলছে। সাধারণ শাখায় ৬ষ্ঠ-১০ম শ্রেনি পর্যন্ত ছাত্রদের এবং কারিগরি শাখায় ইলেক্ট্রিক্যাল, মেকানিকাল ও ড্রেসমেকিং ট্রেডে ছাত্র-ছাত্রীদের পাঠদান করা হয়। প্রতিষ্ঠা কাল থেকে প্রাতিষ্ঠানিক স্বতন্ত্র বৈশিষ্ঠ্য নিয়ে সগৌরবে এগিয়ে&nbsp; চলছে &ldquo;হোমনা আদর্শ উচ্চ বিদ্যালয়&rdquo;। বরাবর এ প্রতিষ্ঠানের ঈর্ষণীয় ফলাফল অর্জন করছে। জেএসসি, এসএসসি, ও এসএসসি (ভোক) পরীক্ষায় শিক্ষার্থীদের ফলাফল এলাকায় বিশেষ দৃষ্টি আকর্ষণ করতে সক্ষম হয়েছে। শিক্ষাসম্পূরক কার্যক্রমেও এ প্রতিষ্ঠানের সাফল্য বরাবর উল্লেখযোগ্য। এই সাফল্যের পেছনে রয়েছে প্রতিষ্ঠানের দক্ষ ও অভিজ্ঞ পরিচালনা পর্ষদ , প্রশাসন ও শিক্ষকবৃন্দের আন্তরিকতা ও মেধা। প্রতিষ্ঠানটিতে রয়েছে ডিজিটাল ও মাল্টিমিডিয়া&nbsp; সমৃদ্ধ&nbsp; আধুনিক পাঠদান পদ্ধতি। এছাড়াও সহ-শিক্ষাক্রমিক কার্যক্রম জোরদার করার জন্য রয়েছে ভাষা ও সাহিত্য ক্লাব, ইংলিশ ল্যাগুয়েজ ক্লাব, সাংস্কৃতিক ক্লাব, গণিত ও বিজ্ঞান ক্লাব, আইসিটি ক্লাব, টেকনিক্যাল ক্লাব, ষ্পোর্টস ক্লাব, কমার্স ক্লাব এবং অত্যন্ত চৌকস ব্র্যান্ড দল ও স্কাউট দল। এমতাবস্থায়, সম্মানিত এলাকাবাসী, শিক্ষানুরাগী ও অভিভাকগণের সর্বাত্নক সহযোগীতা অব্যাহত থাকলে হোমনা আদর্শ উচ্চ বিদ্যালয় জাতীয় পর্যায়ে একটি শ্ৰেষ্ঠ বিদ্যাপীঠ হিসেবে প্রতিষ্ঠিত করতে আমরা অবশ্যই সক্ষম হবো-ইনশাল্লাহ।</p>\r\n<p style="text-align: justify;">লক্ষ্য ও উদ্দেশ্য: সুখী ও সমৃদ্ধ সোনার বাংলা গড়তে প্রয়োজন দক্ষ মানবসম্পদ ও নৈতিক শক্তিতে বলীয়ান সুশিক্ষত নাগরিক। দেশ গঠনের কাজে প্রাতিষ্ঠানিক শিক্ষার উপযোগিতাকে আজকে দিনে কিভাবে আরো ও প্রাসঙ্গিকার করে তোলা যায় সে লক্ষ্যে এই প্রতিষ্ঠান কাজ করে যাচ্ছে। বর্তমান এই প্রতিষ্ঠান ডিজিটাল বাংলাদেশ গড়ার ধারণাকে ধারণ করে তার সার্বিক পরিচালিত করে আসছে। এ জন্য প্রয়োজনীয় ডিজিটাল প্রযুক্তি আহরণ করা হয়েছে। সূচনালগ্ন থেকেই এ প্রতিষ্ঠনটি ধর্মীয় মূল্যবোধ ও নৈতিকতার পরিচর্যাকে প্রাধান্য দিয়ে আসছে। ভবিষ্যৎ নাগরিকদেরকে&nbsp; চরিত্রবান ও মানবিক গুণাবলীসমৃদ্ধ সুনাগরিক হিসাবে তৈরী করাই এ প্রতিষ্ঠানের উদ্দেশ্য। সর্বোপরি এ প্রতিষ্ঠানের লক্ষ্য ও উদ্দেশ্য হচ্ছে পাঠ্যক্রম ও সহপাঠ্যক্রম কর্মসূচির মাধ্যমে শিক্ষাথীদের মেধা ও প্রতিভার বিকাশ সাধন এবং শারীরিক ও মানসিক বৃত্তিগুলোর সুষম বাধন, যাতে তারা সুযোগ্য নাগরিক হিসাবে গড়ে উঠে দেশ ও জাতিকে উপর্যুক্ত নেতৃত্ব দিতে পারে।</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d912.8309749588451!2d90.43068982917363!3d23.771477699036172!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3755c78cd50432a3%3A0x701953e14150c231!2sAnanda+Nagar+Rd%2C+Dhaka+1212!5e0!3m2!1sen!2sbd!4v1490215527170" width="400" height="300" frameborder="0" style="border:0" allowfullscreen></iframe>', 1);
